import React from 'react';
import styled from 'styled-components';

const Footer: React.FC = () =>{
    return(
        <FooterWrap>
            <FooterContainer>

            </FooterContainer>
        </FooterWrap>
    );
}

const FooterWrap = styled.div`
    background-color:#b4b2b2;
    width:100%;
`;

const FooterContainer = styled.div`
    width:1180px;
    margin: 0 auto;
    max-width:100%;
`;
export default Footer;
